def parseNestedParens(paren_string):
    groups = paren_string.split('')
    nesting_levels = []
    for group in groups:
        max_depth = 0
        current_depth = 0
        for char in group:
            if char == '(':
                current_depth += 1
                if current_depth > max_depth:
                    max_depth = current_depth
            elif char == ')':
                current_depth -= 1
        nesting_levels.append(max_depth)
    return nesting_levels

